    true,nt"url": null,nt"notes": "The Residential Energy Consumption Survey
    (RECS) is a national area-probability sample survey that collects energy-related
    data for occupied primary housing units. First conducted in 1978, the 2005 version
    is the 12th RECS. The survey collected data from 4,382 households sampled at random
    using a complex multistage, area-probability design to represent 111.1 million U.S.
    households, the Census Bureau's statistical estimate for all occupied housing units
    in 2005. Data were obtained from residential energy suppliers for each unit in the
    sample to produce the Consumption & Expenditures data.",nt"license_title":
